The query you're looking for is to find suppliers in nations with only one supplier. Here's how to do it:

```sql
SELECT
  s.supplier_name,
  s.row_number AS supplier_row_number,
  n.nationkey,
  n.row_number AS nation_row_number
FROM
  suppliers s
JOIN
  nations n ON s.nationkey = n.nationkey
WHERE
  (
    SELECT
      COUNT(*)
    FROM
      suppliers s2
    WHERE
      s2.nationkey = s.nationkey
  ) = 1;
```

This query first joins the `suppliers` and `nations` tables on the `nationkey` column. Then, it filters the results to only include rows where there is exactly one supplier in the corresponding nation (based on the `nationkey`). This will give you a list of suppliers located in nations with only one supplier.

